jQuery(document).ready(function($){

	// Divers

	$('ul').find('li:first-child').addClass('first');
	$('ul').find('li:last-child').addClass('last');
	$('pre').addClass('prettyprint');prettyPrint();
	$('.lightbox-various').addClass('fancybox.iframe');
	$('input, textarea').placeholder();
	
	// VÃ©rification des formulaires
	$('.form-val').each(function(){
		$(this).attr('onblur', 'verifinput(this)');
		var elem = $(this).attr('onerror');
		if(document.getElementById(elem)) $(document.getElementById(elem)).addClass('on_error');
	});
	
	// TipTip - Tooltips 

	$('.tooltip, .tooltip-top, .tooltip-bottom, .tooltip-right, .tooltip-left').each(function(){
		var position = 'top';
		var content = $(this).attr('title');
		
		if($(this).hasClass('tooltip-top')) position = 'top';
		if($(this).hasClass('tooltip-bottom')) position = 'bottom';
		if($(this).hasClass('tooltip-right')) position = 'right';
		if($(this).hasClass('tooltip-left')) position = 'left';
		
		$(this).attr('title','')
		.tipTip({defaultPosition: position, maxWidth: "250px", content: content, delay: 400});
	});
	
	// Notices
	
	$(".notice.close").append("<a href='#close' class='icon-remove'></a>");
	$(document).on('click', '.notice a[class^="icon-remove"]', function(e){
		e.preventDefault();
		var notice = $(this).parents('.notice');
		$(this).hide();
		notice.fadeOut();
	});
	
	// Menus
	
	$('ul.menu').each(function(){
		$(this).prepend('<li class="toggle-menu"><a href="#"><i class="icon-reorder"></i> Menu</a></li>');
		$(this).find('li').has('ul').addClass('parent')
		.find('a:first').append('<i class="icon-sort-down"></i>');
	});

	$('ul.menu li').hover(
		function(){
			$(this).find('ul:first').stop(true, true).fadeIn('fast');
			$(this).addClass('hover');
		},
		function(){
			$(this).find('ul').stop(true, true).delay(200).fadeOut();
			$(this).removeClass('hover');
	});
	
	
	// FancyBox
	
	$('.lightbox-content').each(function(){
		var elem = $(this).attr('href');
		if (elem.indexOf("#") > -1)
		{
			elem=(elem.substring(elem.indexOf("#")+1));
			if(document.getElementById(elem)) document.getElementById(elem).style.display = "none";
		}
		
	});
	
	$(".lightbox").fancybox({
		openEffect	: 'elastic',
    	closeEffect	: 'elastic',
	});
	
	$(".lightbox-content").fancybox({
		openEffect  : 'none',
		closeEffect : 'none',
		autosize : false,
		afterLoad   : function() {
			this.content = this.content.html();
		}
	});
	
	$('.lightbox-media').fancybox({
		openEffect  : 'none',
		closeEffect : 'none',
		helpers : {
			media : {}
		}
	});
	
	$(".lightbox-various").fancybox({
		maxWidth	: 800,
		maxHeight	: 600,
		fitToView	: false,
		width		: '70%',
		height		: '70%',
		autoSize	: false,
		closeClick	: false,
		openEffect	: 'none',
		closeEffect	: 'none'
	});

	
	// Tabs
	
	$(".tabs-content").addClass("clearfix").not(":first").hide();$("ul.tabs").each(function(){var e=$(this).find("li.active");if(e.length<1){$(this).find("li:first").addClass("active")}e=$(this).find("li.active a").attr("href");$(e).show()});$(document).on("click",'ul.tabs a[href^="#"]',function(e){e.preventDefault();var t=$(this).parents("ul.tabs").find("li");var n=$(this).attr("href");var r=t.filter(".active").find("a").attr("href");$(r).hide();t.removeClass("active");$(this).parent().addClass("active");$(n).show();history.pushState(null,null,window.location.search+$(this).attr("href"));return false});var uri=window.location.hash;if(uri!=""){var allTabs=$("ul.tabs a[href^="+uri+"]").parents("ul.tabs").find("li");var defaultTab=allTabs.filter(".active").find("a").attr("href");$(defaultTab).hide();allTabs.removeClass("active");$("ul.tabs a[href^="+uri+"]").parent().addClass("active");$("#"+uri.replace("#","")).show();}
	
	
	// Slider
	
	$('.slider').bxSlider({
		mode: 'horizontal', // 'horizontal', 'vertical' ou 'fade'
		autoHover: true,
		speed: 500,
		infiniteLoop: true,
		captions: true,
		adaptiveHeight: true,
		touchEnabled: true,
		pause: 3900,
		controls: true,
		autoStart: true,
		auto: true
	});
	
	// block-center
	$('.block-center').each(function(){
		$(this).addClass('inline-block');
		this.style.width = $(this).outerWidth(true) +"px";
		$(this).removeClass('inline-block');
	});
});






